    false,nt"url": null,nt"notes": "This annual narrative report for Windom
    Wetland Management District summarizes District activities during the 1994 calendar
    year.  The report begins with a summary of the yearu2019s highlights and climatic
    conditions.  Land acquisition is also covered.  The report includes a planning section
    which discusses the master plan and public participation.  Administration is outlined;
    information about personnel, volunteer programs, funding, safety, and technical
    assistance is given.  Habitat management is also covered.  Subjects include wetlands,
    croplands, grasslands, fire management, pest control, and private lands.  The wildlife
    section of the report discusses wildlife diversity, endangered species, threatened
    species, waterfowl, marsh birds, water birds, shorebirds, game mammals, and disease
    prevention.  The public uses of the District described in this report include outdoor
    classrooms, hunting, and law enforcement.  The equipment and facilities section
    of the report provides information about rehabilitation, communications systems,
    computer systems, and energy conservation.  Cooperative programs and items of interest
    are provided at the end; brochures are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
